import React from 'react';
import { useTheme } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Container from 'common/Container';
import { DemoPages, Features, Footer, Hero, Highlights } from './components';

const Home = () => {
  const theme = useTheme();
  return (
    <Box>
      <Box
        sx={{
          backgroundImage: 'url("https://assets.maccarianagency.com/backgrounds/bg.jpeg")',
          position: 'relative',
          overflow: 'hidden',
          backgroundSize: 'cover',
          height: '100vh',
        }}
      >
        <Container
          height={'100vh'}
          paddingY={'0 !important'}
        >
          <Hero />
        </Container>
      </Box>
      <Container>
        <Highlights />
      </Container>
      <Container>
        <Features />
      </Container>
      <Box bgcolor={theme.palette.alternate.main}>
        <Container>
          <DemoPages />
        </Container>
      </Box>
      <Container>
        <Footer />
      </Container>
    </Box>
  );
};

export default Home;
